The DMCC Coworking Centre offers businesses smart office and communication solutions to
carry out their daily operations smoothly and hassle-free. 

What DMCC Coworking Centre members can do through the app:
- Book desks, meeting rooms, and shared facilities around the DMCC Coworking Centre;
- Order and pay for coffee and food;
- Receive notifications from the DMCC Coworking Centre Bot and share feedback;
- Access their lockers;
- Engage with other members of the DMCC Coworking Centre community;
- Read news about DMCC Coworking Centre;
- Learn about the different companies at the DMCC Coworking Centre;
- Check out events happening at the DMCC Coworking Centre;
- Request event spaces; and
- Report issues they might face at the DMCC Coworking Centre and receive support.


This app is for members of the DMCC Coworking Centre community. If you are interested in
becoming a member, visit https://www.dmcc.ae and learn more.
